description:
Alright.I had issues trying to upload because apparently I'm out of practice.

This is the mod people have been looking for.The files are in order an are numbered correctly.The file found on Steam of Katia Managan Race Mod has the last file being a Trojan install with spyware.It is pure spyware.I checked it myself.You might not notice it at first but it is spyware.An you should report this person for system infected files.Run NOD32 AntiVirus 8 if you are not 100% sure.

After doing this Download this mod an you should freely be able to run this mod that people have so long desired.Play the adventure you have long since have wanted to play.

She comes with the hat and robes.

Note:There is an odd tattoo on her head you can see if you are using the correct mods.

Required Mod:

Racemenu

SKSE

\\\\\\\\\\\\\\\\\\\\

You're done.Now if there is a modder source other than Loverslab &amp; Nexus Mods.By all means mod this to use even more abilities and keep it up to date on the latest storys


 I should mention this.SKSE is for some scripts written into the mod.So if you say.Hey i don't really need SKSE.Yeah you kind of do.If scripts get out of control they will cause issues.So SKSE does play a part in keeping them controlled.

This means you only NEED RaceMenu to actually have her in your game.Note this. as well.You can use any body type for this character if it is installed.This includes CHSBHC.But it does not support any other Nude Skin textures.So they will not work as far as i know.So if you want to change her body texture.You probably can not.

More notes.This is so far compatible with Familiar Faces.So even after you are done with this character she can be saved in your Jcontainer folder for later as a companion.
